import styled from "styled-components";
export const Bar = styled.div`
display: flex;
flex-direction: row;
justify-content: center;
align-items: center;
padding: 4px 4px 4px 16px;

position: absolute;
width: 728px;
height: 48px;
left: 296px;
top: 16px;

background: #FFFFFF;
border: 1px solid #E0E2EB;
box-sizing: border-box;
border-radius: 4px;
`;

export const Search: React.FC = () => {
    return (
      <Bar>Search</Bar>
    )
}
